import React from "react";
import { NavLink } from "react-router-dom";

function Navbar() {
  return (
    <div className="navbar">
      <NavLink to="/">Startsida</NavLink>
      <NavLink to="/rules">Regler</NavLink>
      <NavLink to="/contact">Kontakt</NavLink>
      <NavLink to="/news">Nyheter</NavLink>
      <NavLink to="/gallery">Galleri</NavLink>
      <a href="https://ifiske.se" target="_blank" rel="noopener noreferrer">iFiske</a>
    </div>
  );
}

export default Navbar;
